      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRExSkKcaRTQhBiPonMYX4tFmUttcsw1m95YA&usqp=CAU" alt ="myPic" className = "card_img" />
      <div className ="card_info">
